// category: how the row is classified for tab display
// "sets"  = row has a set item (may also have a unique)
// "unqs"  = row has only a unique (no set)
// "misc"  = row has neither — belongs to the Misc / Normal category
export type HGCategory = "sets" | "unqs" | "misc";

export type HGRow = {
  tc: string;
  base: string;
  bqlvl: number;
  // Set item on this row (empty string = none)
  setName: string;
  setQ: number;
  // Unique item on this row (empty string = none)
  unqName: string;
  unqQ: number;
  // "Normal" item name — used for misc rows (Essences, Keys, Organs, etc.)
  normName: string;
  category: HGCategory;
};

